      title:
        'Kaz Bałagane prezentuje piąty utwór z płyty Książę Nieporządek i ujawnia tracklistę albumu oraz gości',
      author: 'Redakcja newonce',
      content:
        '{"blocks":[{"key":"3h3mm","text":"Nowy album pana Jacka ukaże się za trzy tygodnie, a my jesteśmy już zaznajomieni z jedną trzecią zawartości. Po On przyszedł tylko, W czapce urodzony, Mikołaj Koper i Ciepła Cola przyszedł czas na Od tego pana.","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":112,"length":52,"style":"ITALIC"},{"offset":167,"length":11,"style":"ITALIC"},{"offset":197,"length":12,"style":"ITALIC"}],"entityRanges":[],"data":{}},{"key":"45e2b","text":"Ile ludzi, tyle opinii, ale zapowiedzi Książę Nieporządek wskazują na to, że możemy mieć do czynienia ze znacznie mocniejszą pozycją niż Chleb i miód. Na pewno wiadomo, że tym razem pojawi się mniej gości. W kawałku Ciepła Cola jest Don Poldon, w Narpiew – Alcomindz, a w Znałem typa – Szpaku. I tyle.","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":39,"length":18,"style":"ITALIC"},{"offset":137,"length":12,"style":"ITALIC"},{"offset":216,"length":11,"style":"ITALIC"},{"offset":247,"length":7,"style":"ITALIC"},{"offset":272,"length":11,"style":"ITALIC"}],"entityRanges":[],"data":{}},{"key":"dpb2c","text":"Preorder wersji deluxe hula już od pewnego czasu. Kupując go tutaj, dostajecie dwie dodatkowe piosenki, których jesteśmy szczególnie ciekawi. Na bonusowym CD Chleb i miód znalazły się kawałki, które stanowiły przecież ścisłą czołówkę tamtego materiału.","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":158,"length":12,"style":"ITALIC"}],"entityRanges":[{"offset":61,"length":5,"key":0}],"data":{}}],"entityMap":{"0":{"type":"LINK","mutability":"MUTABLE","data":{"href":"https://preorder.pl/ksiaze-nieporzadek?campaign-id=13&fbclid=IwAR3P0WiGxpi1Pe1oL3uuEFd09etf1r1NEQbrlM0kEUdT73bX6C5y-z_DYDo","url":"https://preorder.pl/ksiaze-nieporzadek?campaign-id=13&fbclid=IwAR3P0WiGxpi1Pe1oL3uuEFd09etf1r1NEQbrlM0kEUdT73bX6C5y-z_DYDo"}}}}',
