        '{"blocks":[{"key":"abfu2","text":"Peja pojawia się na płytach Young Igiego i Young Multiego, Eldo dogrywa się na Kwiat Polskiej Młodzieży Bedoesa… Muzyka łączy pokolenia? Nic z tych rzeczy! Young Multi wydaje niedługo album TRAPSTAR, w związku z czym odwiedził redakcję CGM i wystosował przesłanie dla starej szkoły.","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":79,"length":24,"style":"ITALIC"},{"offset":189,"length":9,"style":"ITALIC"},{"offset":268,"length":13,"style":"ITALIC"}],"entityRanges":[],"data":{}},{"key":"1nvbi","text":"Nie spodobało się to Bonsonowi, który całą wypowiedź podsumował krótko i dosadnie w komentarzach: ZAMKNIJ DUPE ŁAKU. Później dodał jeszcze m.in.: no łak straszny co więcej mam Ci powiedzieć? Jak uważam, że coś jest ch*jowe to sobie o tym mówię, proste.","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":97,"length":18,"style":"ITALIC"},{"offset":146,"length":105,"style":"ITALIC"}],"entityRanges":[],"data":{}},{"key":"6asut","text":"Co ciekawe, swoje trzy grosze do dyskusji wtrącili DJ Decks (W punkt) oraz Frosti Rege (hahaha je*ać balasa), którym jak widać jest pod drodze z Bonsonem.","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":33,"length":8,"style":"ITALIC"},{"offset":61,"length":7,"style":"ITALIC"},{"offset":88,"length":19,"style":"ITALIC"}],"entityRanges":[],"data":{}},{"key":"3rkud","text":"To nie pierwszy raz, kiedy szczecinianin zabiera się do grillowania przedstawiciela nowej szkoły. Przypominamy jego rant z koncertu we Wrocławiu. Żabson może już jednak odetchnąć z ulgą - mistrz zdrapki najwyraźniej ma nowego faworyta.","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":84,"length":12,"style":"ITALIC"},{"offset":188,"length":14,"style":"ITALIC"}],"entityRanges":[],"data":{}}],"entityMap":{}}',
