        '{"blocks":[{"key":"8qf02","text":"Bo właśnie dziś o godzinie 20 rusza pierwsza, dwugodzinna audycja HYPETALK. Jeśli znacie nazwę, to nie będziemy wam objaśniać, jeśli nie - HYPETALK to największa polska facebookowa grupa skupiająca się wokół streetwearu. Prowadzący: Leo, Kagz i Kuuuubs opowiedzą co nieco o początkach całej inicjatywy, nie zabraknie anegdot i ciekawostek z hypetalkowej kuchni. Co więcej - od przyszłego odcinka będą pojawiać się goście!","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"d9262","text":"Audycji posłuchacie oczywiście na antenie newonce.radio. Stay tuned!","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"lh6k","text":" ","type":"atomic","depth":0,"inlineStyleRanges":[],"entityRanges":[{"offset":0,"length":1,"key":0}],"data":{}}],"entityMap":{"0":{"type":"INSTAGRAM","mutability":"IMMUTABLE","data":{"url":"https://www.instagram.com/p/BqVZ4mIDf_5/?utm_source=ig_embed&utm_medium=loading"}}}}',
