        'W czwartek odbędzie się impreza newonce.paper #4, a my powiemy wam, jak zdobyć zaproszenia',
      author: 'Redakcja newonce',
      content:
        '{"blocks":[{"key":"43v9e","text":"O tym, że czwóreczka wychodzi lada moment wiecie nie od dziś. Tak samo jak o tym, że mamy aż dwie okładki:","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"69iq3","text":" ","type":"atomic","depth":0,"inlineStyleRanges":[],"entityRanges":[{"offset":0,"length":1,"key":0}],"data":{}},{"key":"dbcll","text":"Duże wywiady z Sokołem, Dawidem Podsiadło, Gosią Herman, Zdechłym Osą, Pankejkami i Tylko. Teksty o Ghe20G0TH1k, homoseksualizmie w polskim rapie, basowej scenie Krakowa i tym, czego będziemy słuchać za 10 albo 20 lat. Plus strony, oddane w całości zespołowi SYNY, Pussykrew, Wojtkowi Antonówowi, OSOM i Michałowi Lobie. Tu naprawdę będzie na co czekać.","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"24rjs","text":"Jak zawsze premiera numeru odbędzie się na wyjątkowej imprezie promocyjnej - tym razem bawimy się w przestrzeni nad warszawskim Warmutem (ul. Marszałkowska 45/49). Za konsoletą pojawią się... a to ogłosimy dosłownie za moment, ale spodziewajcie się mocnych połączeń z newonce.paper #4. Sponsorem imprezy jest marka PUMA, partnerem - Ballantine\'s. Ruszamy o godzinie 21 - ważne info dla tych, którzy chcieliby się u nas pojawić, ale nie mają zaproszeń. Od dziś rozdajemy na insta story newonce.paper po 10 podwójnych zaproszeń, wystarczy tylko followować profil i... być czujnym. Ruszamy z rozdawką jeszcze tego wieczora! A do facebookowego eventu dopiszecie się tutaj.","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[{"offset":621,"length":47,"key":1}],"data":{}}],"entityMap":{"0":{"type":"IMAGE","mutability":"IMMUTABLE","data":{"id":24902}},"1":{"type":"LINK","mutability":"MUTABLE","data":{"href":"https://www.facebook.com/events/325211634928541/","rel":"noopener","target":"_blank","url":"https://www.facebook.com/events/325211634928541/"}}}}',
