      title:
        'Pierwszy w Polsce sklep Weekday otworzy się już za parę dni w Krakowie. A później - afterparty z newonce!',
      author: 'Redakcja newonce',
      content:
        '{"blocks":[{"key":"4hl06","text":"Szwedzki brand Weekday działa od 2002 roku i już zdążył zaskarbić sobie serca zaangażowanych i zajaranych streetwearem ludzi na całym świecie. Dlaczego? Bo Weekday to jedna z najbardziej aktualnych marek odzieżowych. Wszystko dzięki temu, że w ich sklepach będziecie mogli znaleźć tzw. zeitgeisty. To projekty ubrań, które są produkowane co tydzień w limitowanych nakładach. Dotyczą aktualnej sytuacji społecznej, kulturalnej czy politycznej na całym świecie, dlatego są tak unikatowe.","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":187,"length":10,"style":"ITALIC"}],"entityRanges":[],"data":{}},{"key":"6uc0o","text":"Pierwsze zeitgeisty zaprojektowane przez polskich artystów (Sylwię Lonkę, Szymona Szelca, Patrycję Makenzy i Włodiego) będziecie mogli zdobyć w sklepowym print studio już 28 listopada od 18:00 do 21:00 w Galerii Kazimierz. Wtedy ruszy rozgrzewka, podczas której zgarniecie 20% zniżki na cały asortyment i... zabierzecie ze sobą vouchery na darmowe drinki podczas afterparty. Poza tym będziecie mogli wrzucić coś na ząb i napić się zarówno wody, jak i piwa. O oprawę muzyczną zadba DJ Kanse. A poniżej grafiki, które będziecie mogli nadrukować na swoich Zeitgeistach:","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"cr40","text":" ","type":"atomic","depth":0,"inlineStyleRanges":[],"entityRanges":[{"offset":0,"length":1,"key":0}],"data":{}},{"key":"56usk","text":" ","type":"atomic","depth":0,"inlineStyleRanges":[],"entityRanges":[{"offset":0,"length":1,"key":1}],"data":{}},{"key":"43b6l","text":" ","type":"atomic","depth":0,"inlineStyleRanges":[],"entityRanges":[{"offset":0,"length":1,"key":2}],"data":{}},{"key":"dqc5o","text":" ","type":"atomic","depth":0,"inlineStyleRanges":[],"entityRanges":[{"offset":0,"length":1,"key":3}],"data":{}},{"key":"5idcp","text":" ","type":"atomic","depth":0,"inlineStyleRanges":[],"entityRanges":[{"offset":0,"length":1,"key":4}],"data":{}},{"key":"1doo2","text":" ","type":"atomic","depth":0,"inlineStyleRanges":[],"entityRanges":[{"offset":0,"length":1,"key":5}],"data":{}},{"key":"79eck","text":"Od 21.00 Weekday zaprasza z kolei do klubu BAL na Zabłociu, gdzie odbędzie się after party z newonce. Zagrają Tycjana i Bubblegun, a na wydarzenie dopiszecie się w tym miejscu. Obecność obowiązkowa!","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[{"offset":162,"length":13,"key":6}],"data":{}},{"key":"2m1c5","text":"Od piątku 29 listopada będziecie mogli wpadać do Weekday już codziennie (no, może oprócz niehandlowych niedziel...). Tylko 29 listopada 50 pierwszych klientów sklepu za swoje zakupy zapłaci aż 50% mniej, a pozostali – 20%. A jeśli wydacie więcej niż 400 zł, to dostaniecie ręcznie zadrukowaną koszulkę Zeitgeist zupełnie za darmo. I takie oferty to my szanujemy.","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}}],"entityMap":{"0":{"type":"IMAGE","mutability":"IMMUTABLE","data":{"id":8351}},"1":{"type":"IMAGE","mutability":"IMMUTABLE","data":{"id":8352}},"2":{"type":"IMAGE","mutability":"IMMUTABLE","data":{"id":8353}},"3":{"type":"IMAGE","mutability":"IMMUTABLE","data":{"id":8354}},"4":{"type":"IMAGE","mutability":"IMMUTABLE","data":{"id":8355}},"5":{"type":"IMAGE","mutability":"IMMUTABLE","data":{"id":8356}},"6":{"type":"LINK","mutability":"MUTABLE","data":{"href":"https://www.facebook.com/events/780170449096965/","url":"https://www.facebook.com/events/780170449096965/"}}}}',
