      title: 'Otsochodzi pięknie popłynął w nowej wersji przeboju Eisa',
      author: 'Redakcja newonce',
      content:
        '{"blocks":[{"key":"1eua0","text":"Gości na poszerzonej wersji Gdzie jest Eis? ciąg dalszy. Był już Bedoes w Najlepszych dniach...","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":28,"length":15,"style":"ITALIC"},{"offset":74,"length":18,"style":"ITALIC"}],"entityRanges":[],"data":{}},{"key":"505lg","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"3cvg8","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"cbq1a","text":" ","type":"atomic","depth":0,"inlineStyleRanges":[],"entityRanges":[{"offset":0,"length":1,"key":0}],"data":{}},{"key":"423ol","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"9ps5c","text":"... był też Oskar w Box i kox...","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":20,"length":9,"style":"ITALIC"}],"entityRanges":[],"data":{}},{"key":"1kvpa","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"c3o2s","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"2l27k","text":" ","type":"atomic","depth":0,"inlineStyleRanges":[],"entityRanges":[{"offset":0,"length":1,"key":1}],"data":{}},{"key":"7o2uc","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"bu6ih","text":"... a teraz czas na drugi singlowy numer z oryginalnej wersji solowego debiutu Eisa. Drugi i chyba ten bardziej rozpoznawalny, zwłaszcza ze względu na najbardziej noonowski beat w karierze Noona. Do Teraz albo nigdy dograł się Otsochodzi:","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":199,"length":16,"style":"ITALIC"}],"entityRanges":[],"data":{}},{"key":"33foe","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"efnef","text":" ","type":"atomic","depth":0,"inlineStyleRanges":[],"entityRanges":[{"offset":0,"length":1,"key":2}],"data":{}},{"key":"30v3t","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"8g6l5","text":"Właściwy feat na właściwym miejscu. Otsochodzi faktycznie brzmi trochę jak zaginiony brat Eisa z 2003 roku, to jest to samo luźne flow i podobny styl pisania - elegancka klamra kompozycyjna, spajająca kiedyś z teraz. Zresztą do tej pory wszyscy goście dowieźli: i Bedoes ze swoją pewną siebie przewózką, i Oskar, który oparł swój numer na cwanym patencie rapowania z perspektywy gościa, o którym w oryginale nawijał Eis. Przypomnijcie sobie jeszcze klasyczną wersję Teraz albo nigdy, do której wideo nakręcił... Sylwester Latkowski.","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":201,"length":6,"style":"ITALIC"},{"offset":210,"length":5,"style":"ITALIC"},{"offset":466,"length":16,"style":"ITALIC"}],"entityRanges":[],"data":{}},{"key":"692k0","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"vpgd","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"ei06l","text":" ","type":"atomic","depth":0,"inlineStyleRanges":[],"entityRanges":[{"offset":0,"length":1,"key":3}],"data":{}},{"key":"1j1kv","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"4mgmf","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"edjvu","text":"A reedycja Gdzie jest Eis? już za moment! Wersje będą dwie: podstawowa (zremasterowana przez NOONa) oraz rozszerzona, z remiksami. Obie wyjdą zarówno na CD, jak i winylu; warto dodać, że winyl z remiksami jest dostępny tylko w preorderze. Także tam kupicie limitowaną edycję t-shirtów. Wydawcą płyty jest Lajka Local Corp w kolaboracji z Def Jam Recordings Poland. Wszystko zamówicie na oficjalnej stronie gdziejesteis.pl","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":11,"length":15,"style":"ITALIC"},{"offset":364,"length":1,"style":"BOLD"}],"entityRanges":[{"offset":365,"length":56,"key":4}],"data":{}}],"entityMap":{"0":{"type":"YOUTUBE","mutability":"IMMUTABLE","data":{"url":"https://www.youtube.com/embed/TAXRrOMK5sc"}},"1":{"type":"YOUTUBE","mutability":"IMMUTABLE","data":{"url":"https://www.youtube.com/embed/9rE685zWTBw"}},"2":{"type":"EMBED","mutability":"IMMUTABLE","data":{"code":"<iframe src=\\"https://open.spotify.com/embed/track/4LLnR8BY8q8oxP34To3x7N\\" width=\\"300\\" height=\\"380\\" frameborder=\\"0\\" allowtransparency=\\"true\\" allow=\\"encrypted-media\\"></iframe>"}},"3":{"type":"YOUTUBE","mutability":"IMMUTABLE","data":{"url":"https://www.youtube.com/embed/pLij_YGwPyI"}},"4":{"type":"LINK","mutability":"MUTABLE","data":{"href":"https://gdziejesteis.pl/","target":"blank","url":"https://gdziejesteis.pl/"}}}}',
