      title:
        'Wizualizacja na biurowcu w samym centrum Warszawy - tak PlayStation 5 wchodzi na polski rynek',
      author: 'Redakcja newonce',
      content:
        '{"blocks":[{"key":"2p9ic","text":"Tak jak wydarzyło się to przy okazji premiery PlayStation 5. Multimedialna instalacja została wyświetlona na budynku Widok Towers - to ten nowy wieżowiec obok Rotundy. Warszawskie wydarzenie to część międzynarodowego projektu Sony Interactive Entertainment, świętującego początek nowej ery gier, poprzez rozświetlanie charakterystycznych budynków w dobrze znanych miejscach z 25 regionów na całym świecie. Na całość wizualizacji składają się różnorodne grafiki związane z konsolą PS5, kontrolerem bezprzewodowym DualSense i samą marką PlayStation. To wszystko działo się już w Nowym Jorku, Tokio, Toronto czy Seulu, a teraz do tej listy dołączyła też Warszawa.","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"3mluv","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"4k7pc","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"alcue","text":" ","type":"atomic","depth":0,"inlineStyleRanges":[],"entityRanges":[{"offset":0,"length":1,"key":0}],"data":{}},{"key":"3m1a8","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"6nmj9","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"dl1d1","text":"Parę słów o samej konsoli i grach na nią. No więc tak - już są premierowe tytuły SIE Worldwide Studios, takie jak Marvel’s Spider-Man: Miles Morales, Demon’s Souls, Sackboy: Wielka Przygoda i Astro’s Playroom. Już niedługo dojdzie kilkadziesiąt nowych tytułów, wśród nich m.in. Call of Duty®: Black Ops Cold War (Activision), Fortnite (Epic Games), FIFA 21 (EA), NBA 2K21 (2K), Godfall (Gearbox Publishing), Watch Dogs®: Legion, Assassin’s Creed® Valhalla (Ubisoft) oraz tytuły od producentów niezależnych, takie jak Bugsnax (Young Horses) czy The Pathless (Giant Squid / Annapurna Interactive). A sama konsola to także centrum rozrywki: będą na niej dostępne superpopularne serwisy streamingowe: Netflix, Amazon Prime Video, Apple TV, Hulu czy Twitch. Zawiera szybki dysk SSD i rozdzielczość 4K (120 klatek na sekundę), jest bezprzewodowy kontroler DualSense i silnik Tempest 3D AudioTech.","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":113,"length":35,"style":"ITALIC"},{"offset":150,"length":13,"style":"ITALIC"},{"offset":165,"length":25,"style":"ITALIC"},{"offset":191,"length":19,"style":"ITALIC"},{"offset":277,"length":35,"style":"ITALIC"},{"offset":326,"length":9,"style":"ITALIC"},{"offset":349,"length":7,"style":"ITALIC"},{"offset":363,"length":8,"style":"ITALIC"},{"offset":378,"length":8,"style":"ITALIC"},{"offset":408,"length":19,"style":"ITALIC"},{"offset":429,"length":27,"style":"ITALIC"},{"offset":517,"length":7,"style":"ITALIC"},{"offset":544,"length":12,"style":"ITALIC"}],"entityRanges":[],"data":{}},{"key":"bhn0c","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"am74f","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"cfgru","text":" ","type":"atomic","depth":0,"inlineStyleRanges":[],"entityRanges":[{"offset":0,"length":1,"key":1}],"data":{}},{"key":"6424h","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"84ceo","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}},{"key":"9f24t","text":"Na polskim rynku konsola PlayStation 5 pojawiła się w czwartek, 19 listopada.","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{}}],"entityMap":{"0":{"type":"IMAGE","mutability":"IMMUTABLE","data":{"id":35340}},"1":{"type":"IMAGE","mutability":"IMMUTABLE","data":{"id":35342}}}}',
